import React from "react";

const Dashboard = () => {
  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <iframe
        style={{
          background: "#F1F5F4",
          border: "none",
          borderRadius: "2px",
          boxShadow: "0 2px 10px 0 rgba(70, 76, 79, .2)",
          width: "100%",
          height: "100%",
        }}
        src="https://charts.mongodb.com/charts-hslms-znydqqe/embed/dashboards?id=66fe559d-d09f-4bb0-8735-efa4e2f2cf11&theme=light&autoRefresh=false&maxDataAge=3600&showTitleAndDesc=false&scalingWidth=fixed&scalingHeight=fixed"
        title="MongoDB Dashboard"
      ></iframe>
    </div>
  );
};

export default Dashboard;
